import classes from './NoQuotesFound.module.css';
import { Link } from 'react-router-dom';

const NoQuotesFound = () => {
  return (
    <div className={classes.noquotes}>
      <p>No quotes found!</p>
      <Link to='/new-quote' className='btn'></Link>
      <a className='btn'>
        Add a Quote
      </a>
    </div>
  );
};

export default NoQuotesFound;
